import React from "react";
import { BrowserRouter, Routes, Route, Link } from "react-router-dom";

const pageOne = () => {
  return (
    <div>
      hohohohhohohoho
      <Link to="pagetwo">go to page 2</Link>
    </div>
  );
};

const pageTwo = () => {
  return (
    <div>
      hahahahahahahahaa
      <Link to="/">back to page 1</Link>
    </div>
  );
};
const App = () => {
  return (
    <div>
      <BrowserRouter>
        <div>
          <Route path="/" exact element={pageOne} />
          <Route path="/pagetwo" element={pageTwo} />
        </div>
      </BrowserRouter>
    </div>
  );
};

export default App;
